import React from "react";
export function Overlay({
  media_id,
  media_category,
  experience,
  watchData,
  listenData,
  setOpenOverlayID,
}) {
  console.log(media_id);
  if (
    experience === "WATCH" &&
    media_id !== -1 &&
    Object.keys(watchData).length > 0
  ) {
    const { data } = watchData;
    const records = data[media_category["category"]];
    const media_data = records.find((key) => key.id === media_id);
    console.log(media_data);
    return (
      <section className="overlay-test">
        <div className="overlay-title">{media_data["name"]}</div>
        <div className="close-button" onClick={setOpenOverlayID(-1)}>
          Close Overlay
        </div>
      </section>
    );
  }
  return <div></div>;
}
